webpackJsonp([0x81b8806e4260],{411:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Web Reactiva",subtitle:"Pellentesque odio nisi, euismod in, pharetra a, ultricies in, diam. Sed arcu.",copyright:"",menu:[{label:"Home",path:"/"},{label:"Acerca de",path:"/about/"},{label:"Contacto",path:"/contact/"}],author:{name:"Web Reactiva",email:"#",telegram:"https://t.me/webreactiva",twitter:"https://twitter.com/webreactiva",github:"https://github.com/delineas",rss:"https://www.danielprimo.io/podcast/feed.xml",vk:"#",ivoox:"http://www.ivoox.com/podcast-web-reactiva_sq_f1454279_1.html",itunes:"https://itunes.apple.com/es/podcast/web-reactiva/id1285264897?mt=2"}}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/posts/humane-typography-in-the-digital-age/",categorySlug:"/categories/typography/"},frontmatter:{title:"Humane Typography in the Digital Age",date:"2017-08-19T22:40:32.169Z",category:"Typography",description:"An Essay on Typography by Eric Gill takes the reader back to the year 1930. The year when a conflict between two worlds came to its term. The machines of the industrial world finally took over the handicrafts."}}},{node:{fields:{slug:"/posts/the-birth-of-movable-type/",categorySlug:"/categories/typography/"},frontmatter:{title:"Johannes Gutenberg: The Birth of Movable Type",date:"2017-08-18T22:12:03.284Z",category:"Typography",description:"German inventor Johannes Gutenberg developed a method of movable type and used it to create one of the western world’s first major printed books, the “Forty–Two–Line” Bible."}}},{node:{fields:{slug:"/posts/the-origins-of-social-stationery-lettering",categorySlug:"/categories/design-culture/"},frontmatter:{title:"The Origins of Social Stationery Lettering",date:"2016-12-01T22:40:32.169Z",category:"Design Culture",description:"Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget, tempor sit amet, ante."}}},{node:{fields:{slug:"/posts/perfecting-the-art-of-perfection/",categorySlug:"/categories/design-inspiration/"},frontmatter:{title:"Perfecting the Art of Perfection",date:"2016-09-01T23:46:37.121Z",category:"Design Inspiration",description:"Quisque cursus, metus vitae pharetra auctor, sem massa mattis sem, at interdum magna augue eget diam. Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Morbi lacinia molestie dui. Praesent blandit dolor. Sed non quam. In vel mi sit amet augue congue elementum."}}},{node:{fields:{slug:"/posts/a-brief-history-of-typography/",categorySlug:"/categories/design-inspiration/"},frontmatter:{title:"A Brief History of Typography",date:"2016-02-02T22:40:32.169Z",category:"Design Inspiration",description:"Morbi in sem quis dui placerat ornare. Pellentesque odio nisi, euismod in, pharetra a, ultricies in, diam. Sed arcu. Cras consequat."}}}]},allPodcastFeedItem:{edges:[{node:{guid:"http://api.spreaker.com/episode/13870033",title:"WR 19: Microframeworks, microservicios y la corrala de vecinos",description:"Los microframewotks y los microservicios se pueden llevar bien y en este episodio quiero demostrártelo. Más info en https://www.danielprimo.io/podcast/19\r\n\r\nRepasamos cosas interesantes descubiertas a lo largo de la semana como cursos y web series antes de entrar en materia. ¿Qué tienen de bueno los microframeworks y los microservicios y en qué nos pueden ayudar? ¿Y de malo? Porque también tienen sus inconvenientes.\r\n\r\nSi te ha gustado el podcast, ¡pásalo! Y quedo muy agradecido si me das un me gusta en ivoox.\r\n\r\nNos seguimos escuchando, ¡gracias!",published:"2018-01-23T15:57:01.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-19"}},{node:{guid:"http://api.spreaker.com/episode/13814441",title:"WR 18: ¡Mamá, quiero ser freelance!",description:"¿Qué diría una madre ante este deseo? Más info en www.danielprimo.io/podcast/18\r\n\r\nLas frases de una madre son una muestra de sabiduría popular y de un legado de años de experiencia. Analizamos algunas de ellas que nos vendrán bien como refrendo a nuestro espíritu emprendedor. Un episodio diferente, no tanto tecnológico.\r\n\r\nPuedes encontrarnos en twitter.com/webreactiva",published:"2018-01-16T13:10:01.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-18"}},{node:{guid:"http://api.spreaker.com/episode/13749618",title:"WR 17: Programar en Kotlin con Borja Quevedo",description:"Entrevista con un experto en programación en Android con Kotlin. Más info en www.danielprimo.io/podcast/17\r\n\r\nBorja Quevedo nos contará como empezar con Kotlin, algunas de sus características mas relevantes y cómo utilizarlo para la programación web. Y es que Kotlin es full stack y por tanto puede ser una buena apuesta si quieres aprender a desarrollar con él.\r\n\r\nNos dará detalles del lenguaje, desde dentro, porque lo utiliza a diario en su trabajo.\r\n\r\nSi te ha gustado el podcast, ¡compártelo en redes sociales! Y si te mola, dale al me gusta en ivoox o déjanos una reseña en iTunes",published:"2018-01-09T10:09:18.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-17"}},{node:{guid:"http://api.spreaker.com/episode/13710136",title:"WR 16: Lo que me gustaría aprender en 2018",description:"Buenos propósitos de año nuevo. Ganas de devorar nuevas tecnologías. Más info en www.danielprimo.io/podcast/16\r\n\r\nQuiero aprender cosas nuevas, creo que todos afrontamos nuevos años o etapas con esa ilusión. Aprender a programar en un nuevo lenguaje, darle caña a las criptomonedas o el blockchain, hacer que las máquinas hablen como humanos...\r\n\r\nSi eres desarrollador no dejes de comentarme si te quedarías con python, go, kotlin o swift. Tu opinión es importante para mi",published:"2018-01-02T16:40:35.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-16"}},{node:{guid:"http://api.spreaker.com/episode/13658913",title:"WR 15: El aguinaldo navideño",description:"4 herramientas gratuitas que me hicieron más feliz en 2017. Más info en https://www.danielprimo.io/podcast/15\r\n\r\nEstas fechas de final de año son el mejor momento para hacer una retrospectiva. En este caso te comento 4 piezas de software que han mejorado mi vida a lo largo de 2017. \r\n\r\nPuedes seguir este podcast en twitter.com/webreactiva \r\n\r\nGracias por tu tiempo, ¡nos escuchamos en 2018!",published:"2017-12-26T11:12:36.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-15"}},{node:{guid:"http://api.spreaker.com/episode/13627323",title:"WR 14: Blockchain explicado como si se entendiera",description:"El blockchain es algo que ha llegado a nuestras vidas y tenemos que comprender. Todas las notas del programa en https://www.danielprimo.io/podcast/14\r\n\r\nTe explico en este episodio mis primeros pasos para comprender qué esconde la tecnología que está por detrás del Bitcoin. Cuáles son los fundamentos básicos para entender el porqué del valor del Bitcoin y, sobre todo, el futuro de la aplicación de esta tecnología.\r\n\r\nSi te gustó el podcast recomiéndalo donde quieras ¡Gracias por darlo a conocer! Puedes seguir el podcast en twitter en @webreactiva. \r\n\r\nGracias por los me gusta en ivoox o los 5 estrellas en itunes.\r\n\r\nY ¡Feliz Navidad!",published:"2017-12-19T17:38:35.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-14"}},{node:{guid:"http://api.spreaker.com/episode/13565951",title:"WR 13: Así creamos nuestro primer chatbot",description:"Esta es la historia de la creación de un chatbot desde cero. Cuento la experiencia, las dificultades y los pasos a seguir. Más en https://www.danielprimo.io/podcast/13\r\n\r\nUnos días libres y el gusanillo de crear alguno nuevo que se salga de la zona de confort me llevan a seguir la pista de la creación de un bot para contar la experiencia y publicarlo. Tanto la versión actual como el código para que cualquiera pueda usarlo.\r\n\r\nHaciendo gala del eslogan del podcast “la tecnología es necesaria, pero las personas somos lo importante” aproveché unos ratos libres para humanizar internet a través de un robot. \r\n\r\nToda una contradicción ;)\r\n\r\nSi te gustó el podcast recomiéndalo donde quieras ¡Gracias por darlo a conocer! Puedes seguir el podcast en twitter en @webreactiva. \r\n\r\nGracias por los me gusta en ivoox o los 5 estrellas en itunes",published:"2017-12-12T15:17:08.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-13"}},{node:{guid:"http://api.spreaker.com/episode/13511346",title:"WR 12: Marketing online y desarrollo web con Óscar Martín",description:"La primera entrevista del podcast es a todo un especialista de montar negocios online Óscar Martín de misingresospasivos nos hará un recorrido por alguno de sus secretos. Más info en https://www.danielprimo.io/podcast/12\r\n\r\nY es que el marketing online es un tema que da mucho de si. Óscar lleva muchos años montando negocios en internet, consiguió éxito con el primero, pero en muchos otros no logró su objetivo. Lo que sí hizo fue acumular experiencia y conocimientos para convertirse en un crack. Además en comohacerunapagina.es compagina esta faceta del marketing online  premium dónde enseña a todo tipo de usuarios a cómo montar una página web.\r\n\r\nMuchas gracias Óscar por tu tiempo, por estar siempre ahí y por ser el primero que se deja entrevistar en este humilde podcast. Cosas muy interesantes las que nos cuenta en este episodio.\r\n\r\nSi te ha gustado el podcast, ¡corre la voz!, compártelo con tus amigos y conocidos. Y si ya el entusiasmo es de nota, bienvenidas sean las 5 estrellas en itunes y los me gusta en ivoox, te dejo los enlaces. ¡Gracias!\r\nhttps://itunes.apple.com/es/podcast/web-reactiva/id1285264897\r\nhttps://www.ivoox.com/podcast-web-reactiva_sq_f1454279_1.html",published:"2017-12-05T10:53:10.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-12"}},{node:{guid:"http://api.spreaker.com/episode/13454096",title:"WR 11: Alternativas a WordPress. ¿Hay alguien ahí fuera?",description:"¿Hay una alternativa real a WordPress? ¿Tiene sentido tan siquiera hablar de ello? Todos los enlaces en https://www.danielprimo.io/podcast/11\r\n\r\nSi existe la opción real de trabajar con otras plataformas de publicación web que no sean WordPress, pero si es cierto que es dificil competir con el rey de los CMS. Tienen que darse casos concretos de requisitos del sistema o del cliente.\r\n\r\nEn este episodio re presento una lista de alternativas, todas Open Source (software libre) agrupadas bajo tres criterios: valentía, investigación y audacidad. \r\n\r\nEspero que te guste. No te olvides de comentar el podcast en las notas del programa o donde estés escuchándolo. ¡Gracias por tu tiempo!",published:"2017-11-28T15:28:20.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-11"}},{node:{guid:"http://api.spreaker.com/episode/13383382",title:"WR 10: Los mejores podcast de programación y tecnología (o casi)",description:'Hablar de "los mejores podcast de tecnología" puede dejar a muchos fuera, pero para celebrar el capítulo 10 quería compartir una lista seleccionada por mi. Todos los enlaces en www.danielprimo.io/podcast/10\r\n\r\nY es que cada uno tiene su lista propia de mejores podcast. Además también quiero compartir con vosotros un pequeño alegato sobre la naturaleza del podcast y cómo darlo a conocer. Aparte del boca a boca, no hay que olvidarse de san Google y trabajar a favor de él. No hay YouTube de los podcasts, pero nosotros podemos contra eso y más.',published:"2017-11-21T15:16:26.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-10"}},{node:{guid:"http://api.spreaker.com/episode/13319600",title:"WR 9: Contenido enriquecido HTML5 con H5P",description:"H5P es una plataforma de código abierto que te permite crear todo tipo de contenidos enriquecidos para dotar a tu web o blog de funcionalidad que no siempre es tan fácil de conseguir. Todos enlaces del episodio en https://www.danielprimo.io/podcast/9\r\n\r\nPodrás crear cuestionarios y vídeos interactivos para tus usuarios sin depender de una plataforma propietaria.\r\n\r\nPuedes ver como crear contenido con H5P en este videotutorial\r\nhttps://www.danielprimo.io/blog/crear-un-cuestionario-interactivo-con-h5p\r\n\r\nAdemás respondemos al feedback, recuerda que puedes encontrar todos los métodos de contacto con el podcast en www.webreactiva.com",published:"2017-11-14T12:38:34.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-09"}},{node:{guid:"http://api.spreaker.com/episode/13264718",title:"WR 8: El programador mató a la startup",description:"Todas las notas del programa en https://www.danielprimo.io/podcast/8\r\n\r\nLa historia de una startup ya aparece como algo cotidiano en series y películas. Pero, ¿por qué la figura del programador es a veces tan comprometida? ¿Por qué se acusa a veces al programador de “matar” a la startup?\r\n\r\nEn este episodio hay un relato que plantea las dificultades a las que se enfrenta un programador o desarrollador cuando se lanza a la ejecución de un proyecto rompedor, de la mano de un emprendedor que tiene un verdadero espíritu de innovación. \r\n\r\nDe los riesgos que corre también hablamos, pero sobre todo, hablamos de las dificultades que encuentra en su camino y los errores que hay que evitar para que todo salga bien. Para que la base tecnológica del negocio funcione.\r\n\r\nTambién te recomiendo mi último videotutorial que combina el JavaScript sin jQuery y una de las API de YouTube para jugar con el reproductor de vídeo https://www.danielprimo.io/blog/cuanto-tiempo-ven-videos-youtube-javascript-youtube-api\r\n\r\nSíguenos en www.webreactiva.com",published:"2017-11-07T12:15:16.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-08"}},{node:{guid:"http://api.spreaker.com/episode/13210675",title:"WR 7: Open Source CRM. Gestiona tus clientes con software libre gratuito",description:"El software libre de código abierto es una realidad totalmente válida para su uso en los CRM. Puedes hacer la gestión de clientes y sus relaciones con el negocio de forma online con cualquiera de estas herramientas.\r\n\r\nTambién si eres desarrollador puedes encontrar un fundamento de trabajo si te especializas en estas herramientas, en una de ellas.\r\n\r\nEn el episodio cuento mi experiencia con ellas y cómo puedes saber cuál elegir como mejor opción para tu proyecto.\r\n\r\nToda la información del podcast en www.danielprimo.io/podcast/7",published:"2017-10-31T15:35:00.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-07"}},{node:{guid:"http://api.spreaker.com/episode/13111917",title:"WR 6: Cómo explicar proyectos tecnológicos a tu jefe o cliente",description:"¿Quién no se ha tenido que enfrentar alguna vez a explicar un proyecto tecnológico? Surgen dudas sobre cómo trasladar procesos complejos a un cliente o a una jefa. Hay que conocer al interlocutor, ponerse en su piel y contar una historia.\r\n\r\nEn este capítulo os cuento algunos trucos y consejos que a mi me valen para elaborar una explicación de un proyecto. En base a un par de experiencias vividas recientemente y a un relato de alguien que no entiende lo que le dicen. \r\n\r\nToda la información del podcast en www.danielprimo.io/podcast/6",published:"2017-10-24T09:51:47.000Z",link:"http://www.spreaker.com/user/10034317/wr-6-como-explicar-proyectos-tecnolo-gic"}},{node:{guid:"http://api.spreaker.com/episode/13058124",title:"WR 5: La historia de los pequeños objetos y la web de componentes",description:"En este episodio hablaremos de los pequeños objetos, de la historia que hay detrás de ellos y como eso es lo que utilizan los Web Components para darnos todo lo necesario para construir nuestra wb de HTML5 de una forma más modular.\r\n\r\nA través de los pequeños objetos que nos narra la historia de este programa vemos como la web basada en componentes es un hecho y podemos utilizarla en nuestro beneficio: reutilización, limpieza, todo son ventajas.\r\n\r\nAdemás responderemos una nueva pregunta de un oyente, ¡anímate a dejar las tuyas!\r\n\r\nToda la info del podcast, con todos los enlaces y comentarios en este enlace\r\nhttp://www.danielprimo.io/podcast/5",published:"2017-10-17T11:53:34.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-05b"}},{node:{guid:"http://api.spreaker.com/episode/13002280",title:"WR 4: Stripe, el gran salto de los pagos online",description:"Un nuevo episodio donde te explico cuál es mi experiencia con Stripe como modelo de pago empezando con una historia que “envenena” a los poderosos. Qué diferencias tiene con PayPal y por qué podrías e incluso deberías usarlo en tus proyectos.\r\n\r\nMi nombre es Dani y puedes encontrarme en danielprimo.io.\r\n\r\nDetallamos las principales características de stripe, dónde aporta más valor y lo excepcional de su API para que integres tu ecommerce, tu web o tu aplicación con este sitema de pagos con tarjeta de crédito online.\r\n\r\nAcabaremos inaugurando la sección de feedback del podcast con una pregunta de David sobre Svn y Git, sistemas ambos de control de versiones.\r\n\r\nToda la información y enlaces de este episodio en este enlace\r\nhttps://www.danielprimo.io/podcast/4\r\n\r\nSi te ha gustado, ¡compártelo! ¡revéndelo! ¡haz lo que quieras con él! :)  Y ya si me escribes y me comentas que te ha parecido, encantado de responderte. Puedes hacerlo en el formulario de contacto de www.danielprimo.io o en nuestra cuenta twitter @webreactiva\r\n\r\n¡Gracias por tu tiempo!",published:"2017-10-10T12:26:20.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-04"}},{node:{guid:"http://api.spreaker.com/episode/12939362",title:"WR 3: Programador, pon un git en tu vida",description:"¿Eres programador y no trabajas con Git? ¿Usas este sistema de control de versiones pero no consigues que tus compañeros o tus jefes se adapten? ¿Eres un jefe de proyecto que está harto de perder horas fusionando el trabajo de tu equipo? ¡Pues este es tu episodio!\r\n\r\nMi nombre es Dani y puedes encontrarme en danielprimo.io.\r\n\r\nBasado en hechos reales os contaré lo que me pasó en la playa cuando era niño, construyendo o, más bien, destruyendo, castillos de arena por no tener buena comunicación de equipo. Un fin trágico para el castillo más grande del mundo mundial.\r\n\r\nIncluso si no eres desarrollador puede venirte bien conocer que esconde esto del git y por qué puede ser bueno para tu trabajo: trabajo distribuido, ramas para no mezclar el trabajo de cada uno sin sentido, \r\n\r\nAcabaremos recomendando todo tipo de software para git y Yourls, un acortador de direcciones web de software libre.\r\n\r\nToda la información y enlaces de este episodio en este enlace\r\nhttps://www.danielprimo.io/podcast/3\r\n\r\nSi te ha gustado, ¡compártelo! ¡revéndelo! ¡haz lo que quieras con él! :) Y ya si me escribes y me comentas que te ha parecido, encantado de responderte\r\nhttps://www.danielprimo.io/contacto",published:"2017-10-03T06:45:04.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-03"}},{node:{guid:"http://api.spreaker.com/episode/12840752",title:"WR 2: La trampa de las plantillas premium",description:"¿Tiene algo bueno una plantilla premium para un proyecto web o móvil? Sinceramente, todos nos hemos tenido que enfrentar a esto en más de una ocasión. Tanto si desarrollas como si has tenido que montar tu web sin tener grandes conocimientos.\r\n\r\nMi nombre es Dani y puedes encontrarme en danielprimo.io.\r\n\r\nAnalizamos los motivos y razones que nos llevan a tener que usar plantillas de pago para Wordpress, Drupal, Joomla... Da igual si trabajáis siempre con programación a medida o incluso si montáis aplicaciones móviles. De hecho primero os contaré la historia de un rey muy tacaño para ir entrando en materia.\r\n\r\nPero no todo está perdido. Os contaré una serie de puntos para tener criterio y hacer una selección lo mejor posible así como un resumen de recursos para que podáis encontrar plantillas de calidad.\r\n\r\nTerminamos con una recomendación de software libre para gestión hospitalaria, centrado en zonas del planeta donde hay escasez de conexión. Se llama HospitalRun y es muy interesante también para ver y estudiar su estructura.\r\n\r\nToda la información y enlaces de este episodio en este enlace\r\n\r\nhttps://www.danielprimo.io/podcast/2",published:"2017-09-20T06:49:27.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-02"}},{node:{guid:"http://api.spreaker.com/episode/12778503",title:"WR 1: Un programador, una oportunidad aprovechada y pasión por el salmón",description:"Este es el primer episodio del podcast Web Reactiva, sobre desarrollo y programación web.  Estoy algo nervioso y encontrarás fallos, pero lo he grabado con mucha ilusión para acompañarte unos minutos con temas que te interesan. Más info en https://www.danielprimo.io/podcast\r\n\r\nMi nombre es Dani y puedes encontrarme en danielprimo.io\r\n\r\nEn este episodio te hablaré de mi afición al salmón y como eso me llevó a tomar decisiones poco acertadas, hasta que vi la luz. Y sí, antes de que lo preguntes, esta historia mucho que ver con la programación y el desarrollo.\r\n\r\nTe recomendaré un libro de 2006 de usabilidad, que ha envejecido estupendamente y es máximamente recomendable.\r\n\r\nFinalizamos con una microsección de software libre, un tema que me apasiona y quiero compartir con vosotros. El protagonista de hoy será sobre reconocimiento facial basado en python.\r\n\r\nGracias por escucharme, por estar aquí en el primer episodio. ¡Muchas gracias de corazón!\r\n\r\nToda la información y enlaces de este episodio en este enlace\r\nhttps://www.danielprimo.io/podcast/1",published:"2017-09-12T20:55:41.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-1"}},{node:{guid:"http://api.spreaker.com/episode/13923627",title:"WR 20: Sitios estáticos y datos dinámicos con Gatsby",description:"Los sitios estáticos generados con contenidos dinámicos. Es el deseo de todo desarrollador web. Apúntate a nuestro canal de telegram en t.me/webreactiva\r\n\r\nPuedes ver todas las notas del programa en www.danielprimo.io/podcast/20\r\n\r\nEn este episodio os hablo de mi experiencia con gatsby y de como sacarle provecho a este moderno y simpático generador de sitios estáticos. Veremos con un ejemplo real cómo crear una web generada a partir de un feed XML de un podcast\r\n\r\nSi te ha gustado, compártelo. Síguenos en twitter.com/webreactiva",published:"2018-01-30T13:17:52.000Z",link:"http://www.spreaker.com/user/10034317/webreactiva-podcast-20"}}]}},pathContext:{}}}});
//# sourceMappingURL=path---index-abc24d910dd0a913d1b1.js.map